import React from 'react';
import im from "../assets/img4.png";

const Login = () => {
  return (
    <div className='form-body'>
            <div className="form-page">
                <div className="left">
                    <form className='form'>
                        <input type='email' id='mail' />
                            
                    </form>
                </div>
                <div className="right">
                <img src ={im} alt='login image'/>
                </div>
            </div>
        
    </div>
  )
}

export default Login
